import React, { Component } from 'react';
import { useState } from 'react'
import { useNavigate } from 'react-router-dom'
import customer from "./Customer.js"

const LoginCustomer = () => {
	const navigate = useNavigate()
	const [username, setUsername] = useState('')
    const [password, setPassword] = useState('');

	const onClickSave = async () =>
	{
		const res = await customer.create(this.state)
		if (res.success) {
			alert(res.message)
			console.log(res);
		}
		else if (res.status==400) {
			console.log(res.status);
			const dataError = []
			const error = res.data.errors

			if (error) {
				error.map((itemerror)=>{
					console.log(itemerror.defaultMessage);
					dataError.push(itemerror.defaultMessage)
				})
				this.setState({errorField:dataError})
			}
			else {
				dataError.push(res.data.message)
				this.setState({errorField:dataError})
			}
		}
		else {
			console.log(res);
			const dataError = []
			dataError.push(res.message);
			this.setState({errorField:dataError});
		}
	}

    return (
		<div className='container'>
		<h1>Welcome to DocApp!</h1>
		<form className="add-form">
			<div className="form-control">
				<label> Email </label>
				<input  type="text"
						placeholder="Enter email" value={username} onChange={(e) => setUsername(e.target.value)} />
			</div>
			<div className="form-control">
				<label> Password </label>
				<input type="password" placeholder="Enter password" value={password} onChange={(e) => setPassword(e.target.value)}/>
			</div>
			</form>
       

				{
					this.state.errorField.map((itemerror)=>{
						return(
							<p class="text-danger">*{itemerror}</p>
						)
					})
				}

				<div class="row">
					<div class="col-md-6 mb-3">
		      	<button onClick={onClickSave()} class="btn btn-primary btn-block" type="submit">Save</button>
					</div>
				</div>
      </div>
    );

};
export default LoginCustomer
